import classes from './Loan.module.css';

const Loan = (props) => {
  return (
    <div className={classes.loanBox}> 
        <div className={classes.loanDetails}>
            <div>
                <h3>Rs 1,20,000</h3>
                <h4>12/02/2021 - 13/08/2021</h4>
            </div>
            <div>
                <p>Emi  - Rs 15,000/month</p>
                <h5>Floating Interest</h5>
            </div>
        </div>
        <div className={classes.userDetails}>
            <p>Applicant name - Arnab Poddar</p>
            <p>Email - arnabpoddar.ap@gmail.com</p>
            <p>Address - Howrah, Shealdah, Kolkata</p>
            <p>Contact - 98430094589</p>
        </div>
    </div>
  );
};

export default Loan;
